description:
IAA Tonight got the chance to chop it up with freshly married Rams HC Sean McVay who had a well known player crash his wedding. Shoutout to Pacman's son, 14-year-old Chris Henry Jr., who has received an offer from Ohio State & has heard from Texas and other major programs. Pacman has adopted all of Chris Henry Sr.'s children and they are all doing extremely well. Plus, the latest in the Deshaun Watson saga as more news has come out. What role did the Texans play in all of this? Is this Carson Wentz's last chance at a starting job in the NFL with the Commanders?

